import React from 'react';
import Navigation from '../components/Navigation';
import SocialNetworks from '../components/SocialNetworks';
import Cube from '../components/home/Cube';


const Home = () => {
  return (
    <div className='home'>
      <Navigation />

      <div className="home-content">

        <div className="home-content-text">
          <h1 className='label'>
            Hello, <br></br>
            Je suis Thomas, <br></br>
            Développeur Web<span></span></h1>
          <a href="./medias/CV_DWWM.pdf" alt ="Curriculum Vitae" target="_blank">
            <span class="home-content-pdf">Télécharger le CV</span>
          </a>

        </div>

        <Cube />


      </div>

      <SocialNetworks />


    </div>

  );
};

export default Home;
